~ Per me entrare alla Peggy Guggenheim Collection è sempre un’emozione, soprattutto quando posso assistere a delle visite guidate che mi permettono di scoprire nuovi aneddoti sui quadri esposti. Se siete a Venezia nei prossimi mesi, vi consiglio di visitare la mostra “Peggy Guggenheim: l’ultima dogaressa” per i seguenti motivi: - viene analizzata la figura di Peggy come collezionista, soprattutto durante il periodo veneziano;
- Gran parte della collezione è esposta, quindi è possibile ammirare opere d’arte che solitamente non sono visibili al pubblico;
- l’allestimento proposto permette una fruizione più intima dei capolavori della collezione. 
#peggyguggenheimcollection #guggenheimvenice @guggenheim_venice ~
